<html lang="en-US" class="js">

<head>

	<style type="text\css">
		.map_wrapper {
    max-width: 100%;
    width: 100%
}

.map_box {
    max-width: 100%;
    margin: 0 auto
}

.map_wrapper .map_aspect_ratio {
    max-width: 100%;
    width: 100%;
    position: relative;
    height: 0
}

.map_wrapper:-webkit-full-screen,
.map_wrapper:fullscreen {
    position: fixed;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
    z-index: 999999;
    padding: 10px;
    width: 100%
}

.map_wrapper:fullscreen .map_aspect_ratio {
    position: inherit;
    padding-bottom: 100%;
    overflow: hidden
}

.map_wrapper:-webkit-full-screen .map_aspect_ratio,
:-webkit-full-screen-ancestor .map_wrapper .map_aspect_ratio {
    padding-top: 100vh !important;
    width: 100% !important
}

.map_wrapper:-webkit-full-screen {
    width: 100vw !important;
    max-width: 100vw !important
}

:-webkit-full-screen-ancestor .map_aspect_ratio {
    width: 100vw !important;
    max-width: 100vw !important
}

.map_wrapper .map_container {
    position: absolute;
    top: 0;
    left: 0;
    bottom: 0;
    right: 0
}

.map_container .map_render {
    height: 100%
}

.imapsCircle-group+.imapsLabel-group {
    pointer-events: none
}

.imapsLabel foreignObject br {
    height: 0;
    content: '';
    clear: both;
    display: block
}

.imapsLabel foreignObject p {
    margin: 0;
    padding: 0
}

.imapsLabel foreignObject {
    box-sizing: content-box
}

.imapsLabel foreignObject img {
    margin: 0;
    padding: 0;
    display: block;
    position: relative;
    max-width: 100%;
    box-sizing: content-box
}

.imapsLabel foreignObject img.aligncenter {
    margin: 0 auto
}

.imapsInnerTooltip {
    display: block;
    white-space: initial;
    word-break: initial;
    word-wrap: initial;
    width: 100%
}

.map_wrapper path {
    transition: inherit
}

.igm_select_mobile_only,
.imaps_fullscreen_button_only_mobile {
    display: none
}

.igm_select_container {
    margin-bottom: 20px
}

.map_controls {
    display: none
}

.imapsButton-group:focus {
    outline: 0
}

@media only screen and (max-width:768px) {

    .igm_select_mobile_only,
    .imaps_fullscreen_button_only_mobile {
        display: block
    }

    .map_wrapper:fullscreen .imaps_fullscreen_button_only_mobile {
        display: none
    }

    @supports (-webkit-hyphens:none) {
        .imaps_fullscreen_button_only_mobile {
            display: none !important
        }

        .imaps_fullscreen_button {
            display: none !important
        }
    }

    .map_controls {
        width: 100%;
        display: flex;
        flex-direction: row;
        justify-content: space-between;
        padding: 20px 0
    }

    .map_controls>div {
        background: #d9d9d9;
        font-size: 1.5em;
        cursor: pointer;
        width: 30%;
        text-align: center;
        border-radius: 3px
    }

    .map_controls .map_home_button {
        display: flex;
        align-items: center;
        justify-content: center
    }

    .map_has_external_controls .imapsZoomControl-group {
        display: none
    }

    .map_wrapper.map_has_external_controls:fullscreen .imapsZoomControl-group {
        display: inherit
    }
}

.elementor-editor-active .map_wrapper .map_render {
    content: 'Map';
    color: #fff;
    background-color: #ccc;
    padding: 20px
}

.elementor-widget-igmap {
    width: 100%
}

.oxygen-body .map_wrapper .map_render {
    content: 'map';
    background-color: #ccc;
    padding: 20px
}


</style>
</head>
